import React from 'react'
import './BrandsIntegeration.css';

const BrandsIntegeration = () => {
  return (
    <div className='brands-integration'>
    <img src={require('../')} className='bi-logos' alt='brand-logos'/>
    </div>
  )
}

export default BrandsIntegeration
